const Search = () => {
    return(
        <div className="input-field col s6">
            <input id="icon_telephone" type="search" className="validate"/>
            <label for="icon_telephone">חפש</label>
            <i className="material-icons prefix">search</i>
      </div>
    )
}

export default Search;
